import React from 'react';
import './style.css';

type searchProps = {
    searchTerm: string
    handleChange: (event : React.ChangeEvent<HTMLInputElement> ) => void
}
export default function SearchBar({searchTerm , handleChange}: searchProps ) {

    return ( 
      <div className="navbar">
       <header>
          <nav>
            <div className = "search-container" >    
              <input 
                className="input-field"
                value = {searchTerm}
                type = 'text' 
                name =' Search' 
                placeholder = 'Search country by name ... ' 
                onChange = {handleChange}   
              ></input>
            </div>  

             <h2><SearchBar searchTerm = {searchTerm} handleChange = {handleChange} /></h2>
               <ul>
                  <li><a href="# ">Home</a></li>
                  <li><a href="# ">Cart</a></li>
               </ul>

          </nav>
      </header>
  </div>
    );
}
